import classes from './ListDropdown.module.css';
import React from "react";





const ListDropdown = (props) => {



    let  DropdownLi = props.menuSidebar.map(e=>
        <li key={e.id}>
            <a className={classes.active} href={e.url}>{e.label}</a>
        </li>

    );

    let  DropdownList = props.menuData.map(e=>
        <li key={e.id} className={classes.li_dropdoun}>
            <a className={classes.active} href={e.url}>{e.label}</a>
        </li>
    );

    return(
        <div   className={classes.menuSidebar} style={props.menuDisplay?{ display:"block"}:{ display:"none" }}>
            <ul  className={classes.sidebar}>
                <li><a className={classes.active} href='/#home'> home</a></li>
                <li><a className={classes.active} href='/about'> about</a></li>
                <li><a className={classes.active} href='#'> services</a>
                    <ul className={classes.ul_dropdoun} >
                        <li className={classes.li_dropdoun}>ios app development </li>
                        <li className={classes.li_dropdoun}>android app development</li>
                        <li className={classes.li_dropdoun}>website development</li>
                        <li className={classes.li_dropdoun}>unity 3D game development</li>
                        <li className={classes.li_dropdoun}>digital marketing service</li>
                        <li className={classes.li_dropdoun}>UI/UX design services</li>
                    </ul>
                 </li>
                <li><a className={classes.active} href='/portfolio'> portfolio</a></li>
                <li><a className={classes.active} href='/blog'> blog</a></li>
                <li><a className={classes.active} href='/contact'> contact</a></li>

            </ul>

        </div>

    );

};

export default ListDropdown;
